webpackJsonp([0x8604517b16c0],{562:function(a,t){a.exports={data:{markdownRemark:{html:'<p>Отношения типов: Агрегация, Композиция, Генарализация, Реализация, Зависимость и Неопределённая зависимость\n[xcut]\nol</p>\n<ul>\n<li>Агрегация, класс Профессор содержит объекты класса Студенты и может существовать без класса студенты\n[img Агрегация]<a href="http://stud.ashcherbakov.ru/uploads/_pages/36/1.jpg%5B/img">http://stud.ashcherbakov.ru/uploads/_pages/36/1.jpg[/img</a>]</li>\n<li>Композиция, класс Машина содержит объекты класса Запчасти и не может существовать без него\n[img Композиция]<a href="http://stud.ashcherbakov.ru/uploads/_pages/36/2.jpg%5B/img">http://stud.ashcherbakov.ru/uploads/_pages/36/2.jpg[/img</a>]</li>\n<li>Генарализация - наследование, потомок является частным случаем родителя. Родитель (надтип) - обобщение потомка (подтип)\n[img Генарализация]<a href="http://stud.ashcherbakov.ru/uploads/_pages/36/3.jpg%5B/img">http://stud.ashcherbakov.ru/uploads/_pages/36/3.jpg[/img</a>]</li>\n<li>Реализация - интерфейс(реализуемая сущность) дёргает методы, реализуемые в реализующих сущностях\n[img Реализация]<a href="http://stud.ashcherbakov.ru/uploads/_pages/36/4.jpg%5B/img">http://stud.ashcherbakov.ru/uploads/_pages/36/4.jpg[/img</a>]</li>\n<li>Зависимость - независимая сущность влияет на зависимую. Кошка "пьёт" воду, студент "читает" книгу\n[img Зависимость]<a href="http://stud.ashcherbakov.ru/uploads/_pages/36/5.jpg%5B/img">http://stud.ashcherbakov.ru/uploads/_pages/36/5.jpg[/img</a>]</li>\n<li>Неопределённая зависимость - независимая сущность как-то влияет на зависимую. Кошка "???" воду, студент "???" книгу\n[img Неопределённая зависимость]<a href="http://stud.ashcherbakov.ru/uploads/_pages/36/6.jpg%5B/img">http://stud.ashcherbakov.ru/uploads/_pages/36/6.jpg[/img</a>]\n/ol\n_ Все диаграммы нарисованы и доступны для редактирования в бесплатной программе UMLet(или онлайн редакторе <a href="http://www.umlet.com/umletino/">http://www.umlet.com/umletino/</a>), исходник в формате uxf:\n[url=https://yadi.sk/d/Szrm1vkurchig]basic.uxf[/url]\n_ В полном размере:\n_ [image=http://stud.ashcherbakov.ru/uploads/_pages/36/mini/new1.jpg new1.jpg]<a href="http://stud.ashcherbakov.ru/uploads/_pages/36/new1.jpg%5B/image">http://stud.ashcherbakov.ru/uploads/_pages/36/new1.jpg[/image</a>]</li>\n</ul>\n<p>_ Источники:\nul</p>\n<ul>\n<li><a href="http://goo.gl/rMgmZ6">http://goo.gl/rMgmZ6</a></li>\n<li><a href="http://www.myshared.ru/slide/922379/">http://www.myshared.ru/slide/922379/</a> slide-62,93</li>\n<li><a href="http://www.myshared.ru/slide/702026/">http://www.myshared.ru/slide/702026/</a> slide 58\n/ul</li>\n</ul>',frontmatter:{date:"2016-05-11",path:"/page/uml-shpargalka-po-strelochkam",title:"UML классовая диаграмма шпаргалка"}}},pathContext:{}}}});
